import React from "react";

const UserInput = (props) => {
  return (
    <div>
      <p>Speaker: <input type="text" onChange={props.changeOutputUsername}/></p> 
      <br></br>
      <input type="text" onChange={props.changeOutputText}/>

    </div>
  );
};
export default UserInput;
